    false,nt"url": null,nt"notes": "Community Planning and Development (CPD)
    has developed profiles that display accomplishments for selected housing, economic
    development, public improvement, and public service activities. These profiles contain
    accomplishments reported, by program year, by CDBG entitlement communities and states
    and are part of HUD's continued effort to provide grantees and citizens with information
    on our programs.nThese profiles provide information on grantee accomplishments by
    the type of activity carried out. The accomplishments appearing in these profiles
    were reported by grantees in the Integrated Disbursement and Information System
    (IDIS). Profiles for grantees will vary, grantees have flexibility in determining
    the housing, economic and community development activities they carry out with CDBG
    funds.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
